const Rand = RandIntRange(1,100);

const IsCommon = Rand <= 80;
const IsUncommon = Rand <= 97 && Rand > 80;
const IsRare = Rand <= 99 && Rand > 97;
const IsHeroic = Rand > 99;

SelectInt(IsCommon, RandIntRange(1,5),SelectInt(IsUncommon, RandIntRange(6,15),SelectInt(IsRare, RandIntRange(16,30),SelectInt(IsHeroic, RandIntRange(31,50),1))))
